import React from 'react'
import img from '../img/freepik.JPG'

const SearchBar = () =>{
    return(
    <>
    <div>
        <h2>This is my search bar</h2>
        <span>
            <img src={img} alt="image not found" />
        </span>
    </div>
    </>
    )
}

export default SearchBar;
